import './App.css';
import Login from './pages/Login';

function App() {
  return (
    <browserRouter>
    <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/Login" element={<Login />} />
      </Routes></browserRouter>

  );
}

export default App;
